import React from 'react';
import {Field,reduxForm} from 'redux-form';
class PlanCreate extends React.Component{
    renderInput(){
        return(
        <div>
            <input/>
        </div>);
    }
    renderInputs() {
        return(
        <div>
            <form>
                <input type="radio" name="plan" value="basic" checked/> ba<br/>
                <input type="radio" name="plan" value="intermediate"/> Female<br/>
                <input type="radio" name="plan" value="advance"/> Other  
            </form> 
        </div>);
    }
    render()
        {
        return (<form>
            <Field name="Age" component={this.renderInput}/>
            <Field name="Weight"  component={this.renderInput}/>
            <Field name="Height"  component={this.renderInput}/>
            <Field name="Plan"  component={this.renderInputs}/>
        </form>);
        }
}
export default reduxForm({
    form:'PLANCREATE'
})(PlanCreate);
